        uint i = 0;
        Balances[] memory b;
        for(i == 0; i < _holdsTokenIds[holder].length; i+=1) {
            uint256 tid = _holdsTokenIds[holder][i];
            b[i] = Balances(holder, _tokenIdtoAddresses[tid],tid, _balances[tid][holder]);
        }
        return b;
    }

